import React from 'react'
import { Route, Routes } from 'react-router-dom'
import ListPages from '../ListPages/ListPages'

const HomePages = () => {

  return (
    <div>
    <Routes>
      <Route path='/list/:id' element={<ListPages/>}/>
    </Routes>
    </div>
  )
}

export default HomePages
